Cadeira giratória-CADEIRA - GIRATÓRIA ENCOSTO ALTO
Assento com apoio em 05 (cinco) pés, com rodízios
Base estofada com material de densidade mínima de 40 (quarenta) kg/m3 ;
Altura da superfície superior ajustável, em relação ao piso, entre 37 cm (trinta e sete centímetros) e 50 cm (cinquenta centímetros).
profundidade útil de no mínimo 40 cm (quarenta centímetros)
Borda frontal arredondada;
Encosto ajustável em altura e em sentido anteroposterior, com forma levemente adaptada ao corpo para proteção da região lombar;
Largura de, no mínimo, 40 cm (quarenta centímetros) e, com relação aos encostos, de no mínimo, 30,5 cm (trinta vírgula cinquenta centímetros);
Altura de, no mínimo, 50 cm (cinquenta centímetros)
Peso máximo suportado, mínimo 120 kg
